        <img
          className="h-full w-full object-cover object-left-top"
          src="https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lu567tcgt2qncb_tn.webp"
          alt=""
        ></img>
      </div>
      <div className="textPart bg-white p-3">
        <div>
        <p className="font-bold opacity-60">Áo nữ đẹp</p>
            <p >Áo đẹp tuyệt vời quẹo lựa +_+</p>
        </div>
        <div className="">
